private static boolean deleteWorked(int doc, IndexReader r) {
  boolean exception = false;
  try {
    // trying to delete from the original reader should throw an exception
    r.deleteDocument(doc);
  } catch (Exception ex) {
    exception = true;
  }
  return !exception;
}

